The area in the survey covers the northern part of the village of{ {Cliffe,}the hamlet of{Lund,}the eastern part of the village of{ {Osgodby,}and the western part of the village of{South Duffield.}
Most of the area is{thinly {populated.}In the four kilometre squares on the north of the survey block there are only two farms and one old railway crossing house.
The A63 Leeds to Hull road, and the Selby to Hull railway, cross the south western corner of the block. A minor road north from Cliffe crosses the Osgodby to South Duffield road on{ {Cliffe Common.}
